import { MutationTree } from 'vuex';
import * as types from './mutation_type';
import {State} from './state';

const mutations: MutationTree<any> = {
  [types.OPEN_CITY_FILTER](state: State) {
    state.searchByCity = true;
  },
  [types.CLOSE_CITY_FILTER](state: State) {
    state.searchByCity = false;
  },
  [types.OPEN_INPUT_FILTER](state: State) {
    state.searchByInput = true;
  },
  [types.CLOSE_INPUT_FILTER](state: State) {
    state.searchByInput = false;
  },
  [types.OPEN_VIDEO_FILTER](state: State) {
    state.searchByVideo = true;
  },
  [types.CLOSE_VIDEO_FILTER](state: State) {
    state.searchByVideo = false;
  },
  [types.OPEN_TYPE_FILTER](state: State) {
    state.searchByType = true;
  },
  [types.CLOSE_TYPE_FILTER](state: State) {
    state.searchByType = false;
  },
  [types.OPEN_OTHER_FILTER](state: State) {
    state.searchByOther = true;
  },
  [types.CLOSE_OTHER_FILTER](state: State) {
    state.searchByOther = false;
  },
  [types.SET_SEARCH_ITEM](state: State, action: any) {
    state.currentTab = action.index;
  },
  [types.SET_CURRENT_CITY](state: State, action: any) {
    state.currentCity = action.city;
  },
  [types.SET_CITY_LIST](state: State, action: any) {
    const cityObj: any = {};
    for (const prop in action.list) {
      if (prop !== '热门') {
        action.list[prop].forEach((city: any) => {
          cityObj[city.group] ? cityObj[city.group].push(city.display)
                              : cityObj[city.group] = [city.display];
        });
      }
    }
    state.cityList = Object.assign({}, state.cityList, cityObj);
  },
  [types.SET_INIT_REGIONS](state: State, action: any) {
    state.initRegions = action.regions;
  },
  [types.SET_INIT_LINES](state: State, action: any) {
    state.initLines = action.lines;
  },
  [types.SET_ROOM_LIST](state: State, action: any) {
    state.roomList = action.list;
  },
  [types.SET_ROOM_CURRENT_REGION](state: State, action: any) {
    state.roomCurrentRegion = action.region;
  },
  [types.SET_ROOM_SUBWAY_LINE](state: State, action: any) {
    state.subwayLine = action.line;
  },
  [types.SET_ROOM_HAS_VIDEO](state: State, action: any) {
    state.hasVideo = action.hasVideo;
  },
  [types.SET_ROOM_TYPE](state: State, action: any) {
    state.type = action.type;
  },
  [types.SET_ROOM_SEX](state: State, action: any) {
    state.roomGender = action.gender;
  },
  [types.SET_ROOM_HAS_SHORT_RENT](state: State, action: any) {
    state.hasShortRent = action.bool ? 1 : 0;
  },
  [types.SET_ROOM_TYPE_AFFIRM](state: State, action: any) {
    state.roomTypeAffirm = action.arr.toString();
  },
  [types.SET_ROOM_MONEY](state: State, action: any) {
    state.roomCostMin = action.obj ? action.obj.min : '';
    state.roomCostMax = action.obj ? action.obj.max : '';
  },
  [types.SET_ROOM_SEQUENCE](state: State, action: any) {
    state.roomSequence = action.sequence;
  },
  [types.CHANGE_ROOM_HAS_NEXT_PAGE](state: State, action: any) {
    state.hasRoomNextPage = action.bool;
  },
  [types.SET_LOCATE_CITY](state: State, action: any) {
    state.locateCity = action.city;
  },
  [types.SET_LOCATE_ADDRESS](state: State, action: any) {
    state.locateAddress = action.address;
  },
  [types.SET_OPEN_INPUT_SEARCH_LIST](state: State, action: any) {
    state.openInputSearchList = action.bool;
  },
  [types.SET_INPUT_SEARCH_LIST](state: State, action: any) {
    state.inputSearchList = action.list;
  },
  [types.SET_ROOM_LONGITUDE_LATITUDE](state: State, action: any) {
    state.longitude = action.longitude;
    state.latitude = action.latitude;
  },
  [types.OPEN_SEARCH_DEMAND_INPUT_FILTER](state: State) {
    state.searchDemandByInput = true;
  },
  [types.CLOSE_SEARCH_DEMAND_INPUT_FILTER](state: State) {
    state.searchDemandByInput = false;
  },
  [types.OPEN_SEARCH_DEMAND_SEX_FILTER](state: State) {
    state.searchDemandBySex = true;
  },
  [types.CLOSE_SEARCH_DEMAND_SEX_FILTER](state: State) {
    state.searchDemandBySex = false;
  },
  [types.OPEN_SEARCH_DEMAND_MONEY_FILTER](state: State) {
    state.searchDemandByMoney = true;
  },
  [types.CLOSE_SEARCH_DEMAND_MONEY_FILTER](state: State) {
    state.searchDemandByMoney = false;
  },
  [types.SET_DEMAND_LIST](state: State, action: any) {
    state.demandList = action.list;
  },
  [types.SET_DEMAND_CURRENT_REGION](state: State, action: any) {
    state.demandCurrentRegion = action.region;
  },
  [types.SET_DEMAND_LONGITUDE_LATITUDE](state: State, action: any) {
    state.demandLongitude = action.longitude;
    state.demandLatitude = action.latitude;
  },
  [types.SET_DEMAND_GENDER](state: State, action: any) {
    state.demandGender = action.gender;
  },
  [types.SET_DEMAND_MONEY](state: State, action: any) {
    const obj = {
      min: action.min,
      max: action.max,
    };
    state.demandMoney = Object.assign({}, state.demandMoney, obj);
  },
  [types.SET_DEMAND_HAS_NEXT_PAGE](state: State, action: any) {
    state.hasDemandNextPage = action.bool;
  },
  [types.SET_DEMAND_SEQUENCE](state: State, action: any) {
    state.demandSequence = action.sequence;
  },
};

export default mutations;
